  false,\n\t\"url\": null,\n\t\"notes\": \"This data set is an ArcGIS shapefile depicting
  land segments in the Chesapeake Bay Watershed and adjacent states of New York, Pennsylvania,
  Maryland, West Virginia, Delaware, Virginia, North Carolina, and Tennessee. Land
  segmentation was based on county boundaries represented by a 1:100,000-scale digital
  dataset. Fifty of the 254 counties and incorporated cities in the model region were
  divided on the basis of physiography and topography, producing a total of 310 land
  segments. The data are projected to the UTM grid coordinate system - Zone 18 NAD27.\",\n\t\"owner_org\":
